"use strict";(self.webpackChunkblog_demo=self.webpackChunkblog_demo||[]).push([[23],{8245:(p,t,s)=>{s.r(t),s.d(t,{data:()=>a});const a={key:"v-87ea532c",path:"/issue/mini%20apps.html",title:"Mini Apps",lang:"zh-CN",frontmatter:{date:"2021/11/26 20:37",title:"Mini Apps",tag:["小程序"]},excerpt:"",headers:[{level:2,title:"小程序错误：[app.json文件内容错误]app.json未找到",slug:"小程序错误-app-json文件内容错误-app-json未找到",children:[]}],git:{updatedTime:null,contributors:[]}}},8802:(p,t,s)=>{s.r(t),s.d(t,{default:()=>i});const a=(0,s(6252).uE)('<h2 id="小程序错误-app-json文件内容错误-app-json未找到" tabindex="-1"><a class="header-anchor" href="#小程序错误-app-json文件内容错误-app-json未找到" aria-hidden="true">#</a> 小程序错误：[app.json文件内容错误]app.json未找到</h2><p>问题描述：</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>在Github上刚刚拉取的代码，导入微信开发者工具打开之后出现如下问题</p></div><img src="https://tuchuang-1313331077.cos.ap-beijing.myqcloud.com/博客/Mini-Apps/1.png" alt=""><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>解决办法： 1.我自己的原因是项目目录没打开对，打开目录的时候 。此文件夹的二级目录必须包含pages，styles，example等主目录。我是把新建一个文件夹之后把克隆的文件夹放里面，打开的是我自己建的文件夹，所以导致错误， <img src="https://tuchuang-1313331077.cos.ap-beijing.myqcloud.com/博客/Mini-Apps/2.png" alt=""><img src="https://tuchuang-1313331077.cos.ap-beijing.myqcloud.com/博客/Mini-Apps/3.png" alt=""></p></div><p>如上图所示应该打开vip文件夹而不是小程序1文件夹 重新打开之后问题解决</p><p>总结：</p><div class="custom-container tip"><p class="custom-container-title">TIP</p><p>1、原因是项目目录不对，项目二级目录下必须有pages，styles，example等主目录。我是因为将别人的项目直接解压过来用，实际上应该解压后打开文件夹二级目录下的项目名称才是对的 2、在创建项目 添加项目时选择的项目目录的文件夹下不能有次级文件夹 如果有次级文件夹 即便是空文件就会报“app.json 未找到入口 app.json 文件，或者文件读取失败，请检查后重新编译。” 3、项目下面不能有其他与项目无关的文件</p></div><p>原文链接：https://blog.csdn.net/weixin_44865458/article/details/115689251</p><p><a href="https://developers.weixin.qq.com/miniprogram/dev/framework/config.html"> 微信小程序文档</a></p>',10),e={},i=(0,s(3744).Z)(e,[["render",function(p,t){return a}]])}}]);